Add a new method to Plan for MyGC, schedule_collection(). This function runs when a collection is triggered. It schedules GC work for the plan, i.e., it stops all mutators, runs the scheduler's prepare stage and resumes the mutators. The StopMutators work will invoke code from the bindings to scan threads and other roots, and those scanning work will further push work for a transitive closure. Though you can add those work packets by yourself, GCWorkScheduler provides a method schedule_common_work() that will add common work packets for you. To use schedule_common_work(), first we need to create a type MyGCWorkContext and implement the trait GCWorkContext for it. We create gc_work.rs and add the following implementation. Note that we will use the default SFTProcessEdges , which is a general work packet that a plan can use to trace objects. For plans like semispace, SFTProcessEdges is sufficient. For more complex GC plans, one can create and write their own work packet that implements the ProcessEdgesWork trait. We will discuss about this later, and discuss the alternatives. pub struct MyGCWorkContext<VM: VMBinding>(std::marker::PhantomData<VM>);
impl<VM: VMBinding> crate::scheduler::GCWorkContext for MyGCWorkContext<VM> { type VM = VM; type PlanType = MyGC<VM>; type ProcessEdgesWorkType = SFTProcessEdges<Self::VM>; type TPProcessEdges = UnsupportedProcessEdges<Self::VM>;
} Then we implement schedule_collection() using MyGCWorkContext and schedule_common_work(). fn schedule_collection(&'static self, scheduler: &GCWorkScheduler<VM>) { scheduler.schedule_common_work::<MyGCWorkContext<VM>>(self); } Delete handle_user_collection_request(). This function was an override of a Common plan function to ignore user requested collection for NoGC. Now we remove it and allow user requested collection.

