Apart from the two approaches above, you can always implement your own ProcessEdgesWork. This is an overkill for simple plans like semi space, but might be necessary for more complex plans. We discuss how to implement it for MyGC. Create a struct MyGCProcessEdges<VM: VMBinding> in the gc_work module. It includes a reference back to the plan, and a ProcessEdgesBase field: pub struct MyGCProcessEdges<VM: VMBinding> { plan: &'static MyGC<VM>, base: ProcessEdgesBase<VM>,
} Implement ProcessEdgesWork for MyGCProcessEdges. As most methods in the trait have a default implemetation, we only need to implement new() and trace_object() for our plan. However, this may not be true when you implement it for other GC plans. It would be better to check the default implementation of ProcessEdgesWork. For trace_object(), what we do is similar to the approach above (except that we need to write the code ourselves rather than letting the macro to generate it for us). We try to figure out which space the object is in, and invoke trace_object() for the object on that space. If the object is not in any of the semi spaces in the plan, we forward the call to CommonPlan. impl<VM: VMBinding> ProcessEdgesWork for MyGCProcessEdges<VM> { type VM = VM; type ScanObjectsWorkType = ScanObjects<Self>; fn new( edges: Vec<EdgeOf<Self>>, roots: bool, mmtk: &'static MMTK<VM>, bucket: WorkBucketStage, ) -> Self { let base = ProcessEdgesBase::new(edges, roots, mmtk, bucket); let plan = base.plan().downcast_ref::<MyGC<VM>>().unwrap(); Self { base, plan } } fn trace_object(&mut self, object: ObjectReference) -> ObjectReference { if object.is_null() { return object; } let worker = self.worker(); let queue = &mut self.base.nodes; if self.plan.tospace().in_space(object) { self.plan.tospace().trace_object( queue, object, Some(CopySemantics::DefaultCopy), worker, ) } else if self.plan.fromspace().in_space(object) { self.plan.fromspace().trace_object( queue, object, Some(CopySemantics::DefaultCopy), worker, ) } else { self.plan.common.trace_object(queue, object, worker) } } fn create_scan_work(&self, nodes: Vec<ObjectReference>, roots: bool) -> ScanObjects<Self> { ScanObjects::<Self>::new(nodes, false, roots, self.bucket) }
} We would also need to implement Deref and DerefMut to our ProcessEdgesWork impl to be dereferenced as ProcessEdgesBase. impl<VM: VMBinding> Deref for MyGCProcessEdges<VM> { type Target = ProcessEdgesBase<VM>; fn deref(&self) -> &Self::Target { &self.base }
} impl<VM: VMBinding> DerefMut for MyGCProcessEdges<VM> { fn deref_mut(&mut self) -> &mut Self::Target { &mut self.base }
} In the end, use MyGCProcessEdges as ProcessEdgesWorkType in the GCWorkContext: pub struct MyGCWorkContext3<VM: VMBinding>(std::marker::PhantomData<VM>);
impl<VM: VMBinding> crate::scheduler::GCWorkContext for MyGCWorkContext3<VM> { type VM = VM; type PlanType = MyGC<VM>; type ProcessEdgesWorkType = MyGCProcessEdges<Self::VM>; type TPProcessEdges = UnsupportedProcessEdges<Self::VM>;
}

